// src/pages/History.js
import React, { useState, useEffect } from 'react';
import {
  Container,
  Box,
  Typography,
  Tabs,
  Tab,
  List,
  ListItem,
  ListItemText,
  IconButton,
  Button,
  CircularProgress,
  Alert,
  Divider
} from '@mui/material';
import ReplayIcon from '@mui/icons-material/Replay';
import DeleteIcon from '@mui/icons-material/Delete';
import { useNavigate } from 'react-router-dom';
import {
  getSearchHistory,
  deleteSearch,
  getFavorites,
  removeFavorite
} from '../services/api';

const History = ({ user }) => {
  const navigate = useNavigate();
  const [tab, setTab] = useState(0);
  const [historyItems, setHistoryItems] = useState([]);
  const [favorites, setFavorites] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');

  // Fetch both history and favorites on mount
  useEffect(() => {
    setLoading(true);
    Promise.all([getSearchHistory(), getFavorites()])
      .then(([histRes, favRes]) => {
        setHistoryItems(histRes.data || []);
        setFavorites(favRes.data || []);
        setError('');
      })
      .catch(() => {
        setError('Failed to load your history or favorites.');
      })
      .finally(() => {
        setLoading(false);
      });
  }, []);

  const handleDeleteHistory = async (id) => {
    try {
      await deleteSearch(id);
      setHistoryItems(items => items.filter(i => i.id !== id));
    } catch {
      setError('Could not delete that history item.');
    }
  };

  const handleDeleteFavorite = async (id) => {
    try {
      await removeFavorite(id);
      setFavorites(items => items.filter(i => i.id !== id));
    } catch {
      setError('Could not remove that favorite.');
    }
  };

  const handleReRun = (query) => {
    // Navigate to home with state (Home component can read location.state.query to auto-search)
    navigate('/', { state: { query } });
  };

  if (!user) {
    return (
      <Container sx={{ py: 4, textAlign: 'center' }}>
        <Typography variant="h6">
          Please sign in to view your history and favorites.
        </Typography>
        <Button variant="contained" onClick={() => navigate('/login')} sx={{ mt: 2 }}>
          Go to Sign In
        </Button>
      </Container>
    );
  }

  if (loading) {
    return (
      <Container sx={{ py: 4, textAlign: 'center' }}>
        <CircularProgress />
      </Container>
    );
  }

  return (
    <Container maxWidth="md" sx={{ py: 4 }}>
      <Typography variant="h4" gutterBottom>
        Your Activity
      </Typography>
      {error && <Alert severity="error" sx={{ mb: 2 }}>{error}</Alert>}

      <Tabs value={tab} onChange={(_, v) => setTab(v)} sx={{ mb: 2 }}>
        <Tab label="Search History" />
        <Tab label="Favorites" />
      </Tabs>
      <Divider />

      {tab === 0 && (
        <List>
          {historyItems.length === 0 && (
            <Typography sx={{ mt: 2 }}>No search history found.</Typography>
          )}
          {historyItems.map(item => (
            <ListItem
              key={item.id}
              secondaryAction={
                <>
                  <IconButton
                    edge="end"
                    aria-label="re-run search"
                    onClick={() => handleReRun(item.query)}
                  >
                    <ReplayIcon />
                  </IconButton>
                  <IconButton
                    edge="end"
                    aria-label="delete history"
                    onClick={() => handleDeleteHistory(item.id)}
                  >
                    <DeleteIcon />
                  </IconButton>
                </>
              }
            >
              <ListItemText
                primary={item.query}
                secondary={new Date(item.created_at).toLocaleString()}
              />
            </ListItem>
          ))}
        </List>
      )}

      {tab === 1 && (
        <List>
          {favorites.length === 0 && (
            <Typography sx={{ mt: 2 }}>No favorites saved.</Typography>
          )}
          {favorites.map(item => (
            <ListItem
              key={item.id}
              secondaryAction={
                <IconButton
                  edge="end"
                  aria-label="remove favorite"
                  onClick={() => handleDeleteFavorite(item.id)}
                >
                  <DeleteIcon />
                </IconButton>
              }
            >
              <ListItemText
                primary={item.title || item.query}
                secondary={new Date(item.created_at).toLocaleString()}
              />
            </ListItem>
          ))}
        </List>
      )}
    </Container>
  );
};

export default History;
